import React, { useState, useEffect } from 'react';
import Projects from "./views/Projects";
import "./style.css";
import TimeLoggerForm from "./components/TimeLogger/TimeLoggerForm";

export default function App() {
    const [selectedProject] = useState<Project>({
        projectId: 1,
        name: 'Project Example',
        deadline: '2024-01-31', // Use an appropriate date format
      });

      const handleLogTime = (logData: { projectId: number; startTime: string; endTime: string }) => {
        console.log(logData);
        // Add logic to handle time logging
      };
    return (
        <>
            <header className="bg-gray-900 text-white flex items-center h-12 w-full">
                <div className="container mx-auto">
                    <a className="navbar-brand" href="/">
                        <TimeLoggerForm selectedProject={selectedProject} onLogTime={handleLogTime} />
                    </a>
                </div>
            </header>

            <main>
                <div className="container mx-auto">
                    <Projects />
                </div>
            </main>
        </>
    );
}

interface Project {
    projectId: number;
    name: string;
    deadline: string; // Use the correct type for your project's deadline 
  }

  interface LogTime {
    onLogTime: (log: { projectId: number; startTime: string; endTime: string }) => void;
 }
